import React, { useState, useEffect } from 'react';

const NewApplication = () => {
  const [formData, setFormData] = useState({
    tckn: '',
    phone: '',
    firstName: '',
    lastName: '',
    email: '',
    address: '',
    monthlyIncome: '',
    loanAmount: '',
    campaign: '',
    term: '',
    interestRate: '',
  });

  const [campaigns, setCampaigns] = useState([]);
  const [terms, setTerms] = useState([]);
  const [isTermEnabled, setIsTermEnabled] = useState(false);

  useEffect(() => {
    // Kampanya bilgilerini backend'den çek
    fetch('/api/campaigns')
      .then(response => response.json())
      .then(data => setCampaigns(data));
  }, []);

  const handleCampaignChange = (e) => {
    const selectedCampaign = e.target.value;
    setFormData({ ...formData, campaign: selectedCampaign });
    
    // Seçilen kampanyaya göre vadeleri backend'den çek
    fetch(`/api/campaigns/${selectedCampaign}/terms`)
      .then(response => response.json())
      .then(data => {
        setTerms(data);
        setIsTermEnabled(true);
      });
  };

  const handleTermChange = (e) => {
    const selectedTerm = e.target.value;
    setFormData({ ...formData, term: selectedTerm });

    // Seçilen vade ve kampanyaya göre faiz oranını backend'den çek
    fetch(`/api/campaigns/${formData.campaign}/terms/${selectedTerm}/interestRate`)
      .then(response => response.json())
      .then(data => setFormData({ ...formData, interestRate: data }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Validasyon kontrollerini yap ve formu gönder
    // ...
  };

  return (
    <form onSubmit={handleSubmit}>
      <input type="text" placeholder="TCKN" value={formData.tckn} onChange={(e) => setFormData({ ...formData, tckn: e.target.value })} required />
      <input type="text" placeholder="Telefon" value={formData.phone} onChange={(e) => setFormData({ ...formData, phone: e.target.value })} required />
      <input type="text" placeholder="Ad" value={formData.firstName} onChange={(e) => setFormData({ ...formData, firstName: e.target.value })} required />
      <input type="text" placeholder="Soyad" value={formData.lastName} onChange={(e) => setFormData({ ...formData, lastName: e.target.value })} required />
      <input type="email" placeholder="Email" value={formData.email} onChange={(e) => setFormData({ ...formData, email: e.target.value })} required />
      <input type="text" placeholder="Adres" value={formData.address} onChange={(e) => setFormData({ ...formData, address: e.target.value })} required />
      <input type="number" placeholder="Aylık Gelir" value={formData.monthlyIncome} onChange={(e) => setFormData({ ...formData, monthlyIncome: e.target.value })} required />
      <input type="number" placeholder="Kredi Tutarı" value={formData.loanAmount} onChange={(e) => setFormData({ ...formData, loanAmount: e.target.value })} required />
      
      <select value={formData.campaign} onChange={handleCampaignChange} required>
        <option value="">Kampanya Seç</option>
        {campaigns.map((campaign) => (
          <option key={campaign.id} value={campaign.id}>{campaign.name}</option>
        ))}
      </select>

      <select value={formData.term} onChange={handleTermChange} disabled={!isTermEnabled} required>
        <option value="">Vade Seç</option>
        {terms.map((term) => (
          <option key={term} value={term}>{term} ay</option>
        ))}
      </select>

      <input type="text" placeholder="Faiz Oranı" value={formData.interestRate} readOnly />

      <button type="submit">Başvuru Tamamla</button>
    </form>
  );
};

export default NewApplication;
